import React from "react";

function Header(){
    let title="";
    const client="react";
    if(client==="flutter"){
        title="learning flutter";
    }else{
        title="learning react";
    }
    return(
        <div className="navbar bg-dark rounded">
             <h1 className="text-white">{title}</h1>
        </div>
    );
}
export default Header;
